from collections import deque

class Solution:
    TARGET = "O"
    BENIGN = "X"
    NEIGHBORS = {(0, 1), (0, -1), (1, 0), (-1, 0)}

    def solve(self, board: list[list[str]]) -> None:
        """
        Do not return anything, modify board in-place instead.
        """
        visited: set[tuple[int, int]] = set()

        num_rows = len(board) - 1
        num_cols = len(board[0]) - 1

        def out_of_bounds(coord: tuple[int, int], inclusive_edge: bool) -> bool:
            if inclusive_edge:
                return coord[1] <= 0 or coord[1] >= num_rows or coord[0] <= 0 or coord[0] >= num_cols
            return coord[1] < 0 or coord[1] > num_rows or coord[0] < 0 or coord[0] > num_cols

        def flip(coords: list[tuple[int, int]]) -> None:
            for coord in coords:
                board[coord[1]][coord[0]] = self.BENIGN

        def bfs(coord: tuple[int, int], visited: set[tuple[int, int]]) -> None:
            queue = deque([coord])
            seen: set[tuple[int, int]] = set()
            to_flip: list[tuple[int, int]] = []

            while queue:
                coord = queue.popleft()
                seen.add(coord)

                # check if coord is target
                if board[coord[1]][coord[0]] == self.TARGET:
                    # if edge, return without flipping
                    if out_of_bounds(coord, True):
                        visited = visited.union(seen)
                        return

                    # add neighbors with bounds checking and flip checking
                    for x_offset, y_offset in self.NEIGHBORS:
                        new_x = coord[0] + x_offset
                        new_y = coord[1] + y_offset
                        new_coord = (new_x, new_y)
                        if out_of_bounds(new_coord, False):
                            continue
                        if new_coord in visited or new_coord in seen:
                            if board[new_y][new_x] == self.TARGET and new_coord in visited:
                                visited = visited.union(seen)
                                return
                            continue
                        queue.append(new_coord)
                    to_flip.append(coord)
            visited = visited.union(seen)
            flip(to_flip)

        for row in range(num_rows):
            for col in range(num_cols):
                coord = (col, row)
                if coord not in visited and board[coord[1]][coord[0]] == self.TARGET and not out_of_bounds(coord, True):
                    bfs(coord, visited)
                visited.add(coord)





